useEffect(() => {
  let isMounted = true;
  axios.defaults.withCredentials = true;

  const fetchData = async () => {
    if (isMounted) {
      await fetchUploadStatus();
    }
  };

  fetchData();
  const intervalId = setInterval(fetchData, 3600000); // Refresh every 1 hour (3600000 milliseconds)

  return () => {
    isMounted = false;
    clearInterval(intervalId);
  };
}, [fetchUploadStatus]);
